import React from "react";
import ReactDOM from "react-dom/client";
import "./index.css";
import App from "./App";
import ControlProvider from "./store/ControlProvider";

const root = ReactDOM.createRoot(document.getElementById("root"));
root.render(
  <React.StrictMode>
    <ControlProvider>
      <App />
    </ControlProvider>
  </React.StrictMode>
);
